const Header = () => {
    // const Navigate = useNavigate();
    
    return (
        <>
         <div  className="Head">
             <div className="userid">
                 <div>USER ID: 06PP125</div>
             </div>
             <div className="right-menu">
             <img src="estate.jpeg" alt="" className="menu-button" />
                 <>User Name</>
                 
                 <img src="down.png" className="downarrow" alt="" ></img>
                <div    className="dropdown-menu">
                   <><Logout/></>
                </div>
                
             </div>
             
             </div>
       

       
        </>
      );
    };
    export default Header;
